import React, { Component } from 'react'
import { gql } from 'apollo-boost'
import { graphql } from 'react-apollo'

const getCarsQuery = gql`
{
	cars {
		name
		year
	}
}`

class CarList extends Component {
	render() {
		return (
		<div>
			<ul>
				<li>Car Name</li>
			</ul>
		</div>
		);
	}
}

export default graphql(getCarsQuery)(CarList);
